import{_ as t,c as p,o as s,a}from"./app.9a9f499d.js";const r="/st0039-01.png",o="/st0039-02.jpg",e="/st0039-03.jpg",l="/st0039-04.jpg",_="/st0039-05.jpg",c="/st0039-06.jpg",i="/st0039-07.jpg",m="/st0039-08.jpg",n="/st0039-09.jpg",g="/st0039-10.jpg",k=JSON.parse('{"title":"PLOC社区参加OS2ATC大会纪录","description":"","frontmatter":{},"headers":[],"relativePath":"smalltalk/st0039.md"}'),h={name:"smalltalk/st0039.md"},d=a('<h1 id="ploc社区参加os2atc大会纪录" tabindex="-1">PLOC社区参加OS2ATC大会纪录 <a class="header-anchor" href="#ploc社区参加os2atc大会纪录" aria-hidden="true">#</a></h1><ul><li>时间：2024-04-03</li><li>撰稿：柴树杉</li><li>转载请注明原文链接：<a href="https://wa-lang.org/smalltalk/st0039.html" target="_blank" rel="noreferrer">https://wa-lang.org/smalltalk/st0039.html</a></li></ul><hr><p>2024年3月30日，第11届开源操作系统年度技术会议（<a href="https://mp.weixin.qq.com/s/AeamKW14p--C0xWM_lZwww" target="_blank" rel="noreferrer">OS2ATC</a>）在北京西郊宾馆成功举办。</p><p><img src="'+r+'" alt=""></p><p>来自凹语言和KCL社区的柴树杉分享《面向WASM的编程语言的探索实践——以KCL和凹语言为例》</p><p><img src="'+o+'" alt=""></p><p>来自HVML社区的薛淑明分享《HVML编程语言及其应用的跨端运行技术》：</p><p><img src="'+e+'" alt=""></p><p>PLOC秘书丁尔男分享《PLOC社区与国产编程语言蓝皮书》：</p><p><img src="'+l+'" alt=""></p><p>以上分享都是在编程语言与系统生态会场，出品人是来自飞漫公司的创始人、HVML语言作者魏永明老师。以下是分场的合影：</p><p><img src="'+_+'" alt=""></p><p>在下午分享结束后，《国产编程语言蓝皮书》编委合影：</p><p><img src="'+c+'" alt=""></p><p>从左到右依次为梁宇宁（蓝皮书特别顾问）、魏永明（HVML语言）、薛淑明（HVML语言）、陈朝臣（洛书语言）、柴树杉（凹语言&amp;KCL语言）、丁尔男（凹语言&amp;PLOC秘书）。</p><p>以下是《国产编程语言蓝皮书》：</p><p><img src="'+i+'" alt=""></p><p>在午餐时间和同为蓝皮书编委的人民邮电的杨海玲老师对未来编程语言的发展方向做了深入讨论。在晚间狮偶语言的作者杜天微专程打车赶到会场附近会师，在喝酒撸串的同时分享了各自项目的发展历程。</p><p>现场的其他照片：</p><p><img src="'+m+'" alt=""></p><p><img src="'+n+'" alt=""></p><p><img src="'+g+'" alt=""></p><p>北京OS2ATC大会之行大家都收获满满，期待4/5月份杭州的PLOC社区的线下聚会。</p>',24),C=[d];function L(f,O,S,T,j,A){return s(),p("div",null,C)}const u=t(h,[["render",L]]);export{k as __pageData,u as default};
